class App extends React.Component{
    constructor(){
      super();
      this.state = {
        loggedIn:0,
        username:'',
        userId:''

      }
    }
  componentDidMount = ()=>{
    let user  = JSON.parse(localStorage.getItem('user'));
    // console.log(JSON.parse(user))

    if(user){
      this.setState(
        {
          loggedIn:1,
          username:user.username,
          userId:user.userId
